CREATE TRIGGER "C##911_WEB_PORTAL"."FINISH_TRIGGER" AFTER UPDATE OF "EMPLOYEE_ACCEPTED" ON "C##911_WEB_PORTAL"."REQUEST_EMPLOYEE" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW 
DECLARE
EMP_ID NUMBER;
VEHICLEID NUMBER;
UPDATED_STATUS NUMBER;
BEGIN
 UPDATED_STATUS := :NEW.EMPLOYEE_ACCEPTED;
 
 IF UPDATED_STATUS = 1 THEN
	VEHICLEID := :NEW.VEHICLE_ID;
	EMP_ID := :NEW.EMPLOYEE_ID;
	
	UPDATE VEHICLE SET OCCUPIED = 0 WHERE VEHICLE_ID = VEHICLEID;
	UPDATE EMPLOYEES SET OCCUPIED = 0 WHERE MEMBER_ID = EMP_ID;
END IF;

END;
